import React from "react";
import styled from 'styled-components';
const Wrapper = styled.div`
  width: 250px;
  height: 501px;
`

export const Slider: React.FC<ISlider> = props => (
    <div>{props.imgArray.map(img => <img src={img} alt="slide"/>)}</div>
);

interface ISlider {
    imgArray: string[];
}
